History, War Documentary hosted by David Robb, published by History Channel in 2006 - English narration


Information
------------------------------

Dogfights: Greatest Air Battles
Both vicious and violent the dogfight is one of war's most intense forms of combat. In this high-speed special get a thrilling feel for what it's like to engage with the enemy thousands of feet in the air. Featuring four legendary air battles from different periods in history Dogfights uses advanced computer graphics animation firsthand accounts and archival footage to make these exhilarating and dangerous confrontations all too real. As each conflict ensues meet the courageous pilots behind the controls and get in-depth knowledge of the fights they were engaged in the history and technology of the aircraft's they flew and the mortal enemies they faced. From early biplanes to advanced jets machine guns to missiles experience the battles dissect the tactics and relive the moments of truth in one of the world's most dangerous pursuits.

